import React, {Component} from 'react';

class Host extends Component {
    render() {
        return (
            <div className="container">
                <section className="jumbotron text-center">
                    <div className="container">
                        <h1 className="jumbotron-heading">Hosting rẻ không phải là kém</h1>
                        <p className="lead">RNode giúp mọi người tiết kiệm nhiều thời gian và công sức khi tạo trang web, bằng việc cung cấp dịch vụ hosting giá rẻ với chất lượng vượt trội. Các tính năng cao cấp của một premium web hosting và đội ngũ hỗ trợ trực tuyến chuyên nghiệp sẽ dành riêng cho bạn khi mua hosting của chúng tôi. Bất kể bạn đang ở đâu, bạn đều nên tiết kiệm mỗi ngày, hãy bắt đầu từ hôm nay nhé! Tính năng vượt trội chính là yếu tố RNode lấy làm mũi nhọn để đảm bảo RNode không chỉ là một nhà cung cấp phù hợp đa số người dùng, còn là một nhà cung cấp được lựa chọn bởi những người dùng thông minh.</p>
                        <p>
                            <a href="#" className="btn btn-danger my-2">Start your website now!</a>
                        </p>
                    </div>
                </section>
            </div>
        );
    }
}

export default Host;
